import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './home';


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/" element={<Home></Home>} />
        </Routes>
      </Router>
    </div>
  );
}
export default App();
